import React from 'react';
import './Header.css'; 
import northIndianImg from '../assets/food/20.png';
import southIndianImg from '../assets/food/21.png';
const Header = () => {
  return (
    <header id="header" className="text-center py-5">
      <h1 className="display-4">Welcome to My Foody Restaurant</h1>
      <div className="container">
        <div className="row">
          <div className="col-md-6">
            <img
              src="./assets/food/20.png" // Adjust the path
              alt="North Indian Food"
              className="img-fluid mb-3"
            />
            <h3>North Indian Cuisine</h3>
            <p>Delicious North Indian dishes made with authentic spices.</p>
          </div>
          <div className="col-md-6">
            <img
              src="../assets/21.png" // Adjust the path
              alt="South Indian Food"
              className="img-fluid mb-3"
            />
            <h3>South Indian Cuisine</h3>
            <p>Explore a variety of South Indian foods that are rich in flavor.</p>
          </div>
        </div>
      </div>
    </header>
  );
};

export default Header;
